import ExpenseItem from "./ExpenseItem";
import './ExpensesItemBase.css';
import Card from "../UI/Card";
import ExpensesFilter from "../ExpenseFilter/ExpensesFilter";

function ExpensesItemBase(props) {
    const saveSelectedYear = (enteredYear) =>{
        const setSelectedYear = {
            ...enteredYear
        }
    };

    return (
        <div>

       <Card className="expenses">
           <ExpensesFilter onSelectedYear={saveSelectedYear}></ExpensesFilter>
        <ExpenseItem
    title={props.data[0].title}
    amount={props.data[0].amount}
    date={props.data[0].date}
    />
    <ExpenseItem
        title={props.data[1].title}
        amount={props.data[1].amount}
        date={props.data[1].date}
    />
    <ExpenseItem
        title={props.data[2].title}
        amount={props.data[2].amount}
        date={props.data[2].date}
    />
    <ExpenseItem
        title={props.data[3].title}
        amount={props.data[3].amount}
        date={props.data[3].date}
    />
       </Card>
        </div>
)
    ;
}

export default ExpensesItemBase;
